create table if not exists "paintings"
(
    id          varchar(255)  UNIQUE NOT NULL DEFAULT (gen_random_uuid()),
    title       varchar(255)    not null,
    description varchar(1000),
    artist_id   varchar(255)     not null,
    museum_id   varchar(255),
    content     TEXT,
    primary key (id)
);

